const root = createRoot(rootElement);

root.render(
  <BrowserRouter> 
  <StrictMode>
    <div class= "background"> 
      <div className = "container"> 
      <Cities cityName = "New York"/>

      <Condition description = "Windy" degrees = "17" humidity = "80">
          </Condition> 


    </div>
    </div>
  </StrictMode>
   </BrowserRouter>
);
